import { Link } from "react-router-dom";

const NavigationBar = () => {
    
    return (
    <>
        <button>Abstrakt</button>
        <Link to={"/home"} key={1}>home</Link>
        <Link to={"/home"} key={1}>products</Link>
        <Link to={"/home"} key={1}>collections</Link>
        <Link to={"/home"} key={1}>cart</Link>
        <Link to={"/home"} key={1}>about</Link>
    </>
    )

}

export default NavigationBar
